// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import '@openzeppelin/contracts/utils/Address.sol';
import '@openzeppelin/contracts/security/ReentrancyGuard.sol';
import '@openzeppelin/contracts/utils/math/SafeMath.sol';

contract DodgerPayments is ReentrancyGuard {
  using Address for address;
  using SafeMath for uint256;

  uint private totalPayments;    // the amount of donations
  uint cost;
  address payable owner;

  /// Contract settings
  constructor() {
    /// The cost is 0.0015 Eth
    uint num = 15;
    uint num2 = 10000;
    cost = num.div(num2);
    owner = payable(msg.sender); // setting the contract creator
  }

  /// @notice Checks if an address is the owner
  modifier onlyOwner() {
      require(msg.sender == owner, "Not authorized.");
      _;
  }

  /// @notice Checks if an address is the owner
  modifier exactPayment() {
      require(msg.value == cost, "Please enter the exact amount of 0.0015 Eth.");
      _;
  }

   /// @notice Checks if an address is the owner
  modifier hasEnoughFunds() {
      require(msg.sender.balance < msg.value, "Please make sure that your balance has at least 0.0016 Eth.");
      _;
  }

  /// Public function to return the amount of donations
  function getTotalPayments() view public returns(uint) {
    return totalPayments;
  }

  /// Public function to make a payment to the owner
  function payment() public payable hasEnoughFunds() exactPayment()  {
    uint payment = msg.value;
    totalPayments = totalPayments + payment;
    owner.send(msg.value);
  }

  /// The owner can withdraw money
  function withdraw(uint _amount) onlyOwner public {
      owner.transfer(_amount);
  }   

  ///@dev receive() and fallback() functions to allow the contract to receive ETH and data  
  receive() external payable {
  }

  fallback() external payable {
  }
}
